import React from 'react';

const Frame4a21 = () => {
  return (
    <div
      style={{
        width: '366px',
        minHeight: '493px',
        display: 'flex',
        flexDirection: 'column',
        gap: '18px',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame4a21 content goes here */}
      <div
        style={{
          width: '366px',
          height: '76px',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 600,
          fontSize: '28px',
          lineHeight: '38px',
          letterSpacing: '-0.05em',
          color: 'rgba(22,17,13,1)',
          textTransform: 'capitalize',
        }}
      >
        A new way to move goods <span style={{ color: 'rgba(22,17,13,1)' }}>Tap. Track. Done.</span>
      </div>
    </div>
  );
};

export default Frame4a21;
